import {
  StyledMenuBarContainer,
} from "../styles";

const MenuBar = () => {
  return (
    <StyledMenuBarContainer>
      <div className="windows-icons-group">
        <img src='../assets/close.svg' alt="Traffic Light - Close" />
        <img src='../assets/minimize.svg' alt="Traffic Light - Minimize" />
        <img src={require('../assets/zoom.svg')} alt="Traffic Light - Zoom" />
      </div>
    </StyledMenuBarContainer>
  )
}

export default MenuBar;
